import React, {useState, useEffect} from 'react'
import {useParams} from "react-router-dom";
import axios from "axios";
import editIcon from '../../images/edit2.png';
import Checkbox from '../../component/checkbox/Checkbox';

const Asasmenawal = () => {
  
  const {id} = useParams();
  const nilai = Number(id);

  const [kegawatanPernafasanSelected, setKegawatanPernafasanSelected] = useState([]);
  // const [jalanNafasEditSelected, setJalanNafasEditSelected] = useState([]);
  const jalanNafasString = kegawatanPernafasanSelected.join(', ');
  // const jalanNafasEditString = jalanNafasEditSelected.join(', ');

  const [kehilanganTonusOtotSelected, setKehilanganTonusOtotSelected] = useState([]);
  // const [jalanNafasEditSelected, setJalanNafasEditSelected] = useState([]);
  const kehilanganTonusOtotString = kehilanganTonusOtotSelected.join(', ');
  // const jalanNafasEditString = jalanNafasEditSelected.join(', ');

  const handleCheckboxKegawatanPernafasanChange = (event) => {
    const value = event.target.value;
    if (event.target.checked) {
      setKegawatanPernafasanSelected([...kegawatanPernafasanSelected, value]);
    } else {
      setKegawatanPernafasanSelected(kegawatanPernafasanSelected.filter(item => item !== value));
    }
  };

  const handleCheckboxkehilanganTonusOtotSelectedChange = (event) => {
    const value = event.target.value;
    if (event.target.checked) {
      setKehilanganTonusOtotSelected([...kehilanganTonusOtotSelected, value]);
    } else {
      setKehilanganTonusOtotSelected(kehilanganTonusOtotSelected.filter(item => item !== value));
    }
  };
  return (
    <>
    <div className='text-left px-1 bg-emerald300 font-semibold'>
        Asesmen Awal Pasien IGD
    </div>
    <div className='container border border-state-300  bg-white p-5 text-left'>
      <form>
        <p className='font-semibold'>1.	Gejala seperti mau muntah dan kesulitan bernafas</p>
        <div className='container ml-2'>
        <label className='font-semibold'>a. Kegawatan Pernafasan</label>
        <div className='flex'>
          <div className='checkbox mr-2'>
            <Checkbox checked={kegawatanPernafasanSelected.includes('Dyspnoe')} onChange={handleCheckboxKegawatanPernafasanChange} name="kegawatan_pernafasan" label="Dyspnoe" value="Dyspnoe" class="form-checkbox h-3 w-3 mr-1 text-emerald" />
            <Checkbox checked={kegawatanPernafasanSelected.includes('Nafas Tak Teratur')} onChange={handleCheckboxKegawatanPernafasanChange} name="kegawatan_pernafasan" label="Nafas Tak Teratur" value="Nafas Tak Teratur" class="form-checkbox h-3 w-3 mr-1 text-emerald" />
            <Checkbox checked={kegawatanPernafasanSelected.includes('Ada Sekret')} onChange={handleCheckboxKegawatanPernafasanChange} name="kegawatan_pernafasan" label="Ada Sekret" value="Ada Sekret" class="form-checkbox h-3 w-3 mr-1 text-emerald" />
          </div>
          <div className='checkbox mr-2'>
            <Checkbox checked={kegawatanPernafasanSelected.includes('Nafas Cepat dan Dangkal')} onChange={handleCheckboxKegawatanPernafasanChange} name="kegawatan_pernafasan" label="Nafas Cepat dan Dangkal" value="Nafas Cepat dan Dangkal" class="form-checkbox h-3 w-3 mr-1 text-emerald" />
            <Checkbox checked={kegawatanPernafasanSelected.includes('Nafas Melalui Mulut')} onChange={handleCheckboxKegawatanPernafasanChange} name="kegawatan_pernafasan" label="Nafas Melalui Mulut" value="Nafas Melalui Mulut" class="form-checkbox h-3 w-3 mr-1 text-emerald" />
            <Checkbox checked={kegawatanPernafasanSelected.includes('SpO2 < Normal')} onChange={handleCheckboxKegawatanPernafasanChange} name="kegawatan_pernafasan" label="SpO2 < Normal" value="SpO2 < Normal" class="form-checkbox h-3 w-3 mr-1 text-emerald" />
          </div>
          <div className='checkbox mr-2'>
            <Checkbox checked={kegawatanPernafasanSelected.includes('Nafas Lambat')} onChange={handleCheckboxKegawatanPernafasanChange} name="kegawatan_pernafasan" label="Nafas Lambat" value="Nafas Lambat" class="form-checkbox h-3 w-3 mr-1 text-emerald" />
            <Checkbox checked={kegawatanPernafasanSelected.includes('Mukosa Oral Kering')} onChange={handleCheckboxKegawatanPernafasanChange} name="kegawatan_pernafasan" label="Mukosa Oral Kering" value="Mukosa Oral Kering" class="form-checkbox h-3 w-3 mr-1 text-emerald" />
            <Checkbox checked={kegawatanPernafasanSelected.includes('T.A.K')} onChange={handleCheckboxKegawatanPernafasanChange} name="kegawatan_pernafasan" label="T.A.K" value="T.A.K" class="form-checkbox h-3 w-3 mr-1 text-emerald" />
          </div>
        </div>

        <label className='font-semibold'>b. Kehilangan Tonus Otot</label>
        <div className='flex'>
          <div className='checkbox mr-2'>
            <Checkbox checked={kehilanganTonusOtotSelected.includes('Mual')} onChange={handleCheckboxkehilanganTonusOtotSelectedChange} name="kehilangan_tonus_otot" label="Mual" value="Mual" class="form-checkbox h-3 w-3 mr-1 text-emerald" />
            <Checkbox checked={kehilanganTonusOtotSelected.includes('Sulit Menelan')} onChange={handleCheckboxkehilanganTonusOtotSelectedChange} name="kehilangan_tonus_otot" label="Sulit Menelan" value="Sulit Menelan" class="form-checkbox h-3 w-3 mr-1 text-emerald" />
            <Checkbox checked={kehilanganTonusOtotSelected.includes('Inkontinensia Alvi')} onChange={handleCheckboxkehilanganTonusOtotSelectedChange} name="kehilangan_tonus_otot" label="Inkontinensia Alvi" value="Inkontinensia Alvi" class="form-checkbox h-3 w-3 mr-1 text-emerald" />
          </div>
          <div className='checkbox mr-2'>
            <Checkbox checked={kehilanganTonusOtotSelected.includes('Penurunan Pergerakan Tubuh')} onChange={handleCheckboxkehilanganTonusOtotSelectedChange} name="kehilangan_tonus_otot" label="Penurunan Pergerakan Tubuh" value="Penurunan Pergerakan Tubuh" class="form-checkbox h-3 w-3 mr-1 text-emerald" />
            <Checkbox checked={kehilanganTonusOtotSelected.includes('Distensi Abdomen')} onChange={handleCheckboxkehilanganTonusOtotSelectedChange} name="kehilangan_tonus_otot" label="Distensi Abdomen" value="Distensi Abdomen" class="form-checkbox h-3 w-3 mr-1 text-emerald" />
            <Checkbox checked={kehilanganTonusOtotSelected.includes('T.A.K')} onChange={handleCheckboxkehilanganTonusOtotSelectedChange} name="kehilangan_tonus_otot" label="T.A.K" value="T.A.K" class="form-checkbox h-3 w-3 mr-1 text-emerald" />
          </div>
          <div className='checkbox mr-2'>
            <Checkbox checked={kehilanganTonusOtotSelected.includes('Sulit Berbicara')} onChange={handleCheckboxkehilanganTonusOtotSelectedChange} name="kehilangan_tonus_otot" label="Sulit Berbicara" value="Sulit Berbicara" class="form-checkbox h-3 w-3 mr-1 text-emerald" />
            <Checkbox checked={kehilanganTonusOtotSelected.includes('Inkomtimensia Urine')} onChange={handleCheckboxkehilanganTonusOtotSelectedChange} name="kehilangan_tonus_otot" label="Inkomtimensia Urine" value="Inkomtimensia Urine" class="form-checkbox h-3 w-3 mr-1 text-emerald" />
          </div>
        </div>

        <label className='font-semibold'>Nyeri</label>
        <div className='flex'>
          <div className='checkbox mr-2'>
            <Checkbox checked={kehilanganTonusOtotSelected.includes('Tidak')} onChange={handleCheckboxkehilanganTonusOtotSelectedChange} name="nyeri" label="Tidak" value="Tidak" class="form-checkbox h-3 w-3 mr-1 text-emerald" />
